(15, 'coopertone', '1471483668814337304.jpg', '', 'http://PTK', 50, 1),
(16, 'SKINFOOD', '1471483898359529359.jpg', 'Skin Food 以健康饮食疗法作为护肤的中心理念，采用日常食用的食物精华，制成不同的化妆护肤产品，为肌肤注入纯天然食物营养。Skin Food 以守护天使作为品牌标志，象征无论何时何地都守护着您的肌肤，肩负起保卫顾客肌肤的重大使命。所有 Skin Food 产品均印有守护天使标志，代表着产品已得到守护与祝福！ 　　SKIN FOOD 自去年4月由皇宇科技引进台湾并创立直营店以来，以高品质，精致包装、合理价格、亲切服务为品牌诉求的整体形象，深受消费者肯定，消费者在使用过产品后更对于SKIN FOOD 有着与百货公司专柜媲美的高品质，但却只有专柜品牌不到二分之一价格的魅力而风靡不已。因为自有工厂的优势，所以SKIN FOOD目前已拥有近600项商品，而且依照季节推出新品，就像SKIN FOOD 中文含义“肌肤的食物“一样，强调的是让肌肤吃到最营养的美食，也因此提出”新肌肤美事主义“的品牌诉求，今年更以奈米高科技研发出包括：蘑菇双效保养系列等新品。尤其SKIN FOOD 整体CIS形象独特的专卖店经营型态更是优于其他开架式复合品牌，不仅业绩高于同业，更成为消费者肯定的最佳品牌。', 'http://www.skinfoodchina.com/', 50, 1),
